let sketch = (p) => {
  let p1 = {x: 10, y: 200}
  let p2 = {x: 10, y: 20}
  let p3 = {x: 200, y: 200}

  let t = 0 
  let tracking = 0

  let collect = []

  p.setup = () => {
    p.createCanvas(500, 500)
  }

  p.draw = () => {
    p.background("white")
    let p1 = M.p1
    let p2 = M.p2
    let p3 = M.p3

    if(tracking == 1) M.p1 = {x: p.mouseX, y: p.mouseY}
    if(tracking == 2)  M.p2 = {x: p.mouseX, y: p.mouseY}
    if(tracking == 3)  M.p3 = {x: p.mouseX, y: p.mouseY}

    curve(p1, p2, p3)
    let moveRight = {x: 50, y: 0}
    let p4 = vecAdd(p1, moveRight)
    let p6 = vecAdd(p4, moveRight)
    let p7 = vecAdd(p6, moveRight)
    curve(p4, p2, p3)
    curve(p6, p2, p3)
    curve(p7, p2, p3)

    t+=.005
    if (t > 1) {
      collect = []
      t = 0
    }
  }

  p.mouseClicked = () => {
    tracking = (tracking+1) % 4

  }

  function vecAdd(vec1, vec2) {
    return {
            x: vec1.x + vec2.x,
            y: vec1.y + vec2.y
           }
  }

  function curve(p1, p2,  p3,) {
    p.stroke(255, 255, 0, 155)
    p.fill(0, 55)
    let b1 = line(p1, p2)
    let b2 = line(p2, p3)
    let point = line(b1, b2)

    collect.push(point)
    collect.forEach((pp) => {
      p.fill(0)
      p.circle(pp.x, pp.y, 2)
    })

  }

  function line(point1, point2) {
    let x1 = point1.x
    let y1 = point1.y
    let x2 = point2.x
    let y2 = point2.y

    let lerp_x = p.lerp(x1, x2, t)
    let lerp_y = p.lerp(y1, y2, t)

    p.line(x1, y1, x2, y2)
    p.circle(x1, y1, 5)
    p.circle(x2, y2, 5)

    p.circle(lerp_x, lerp_y, 2)

    return({x: lerp_x, y: lerp_y})

  }


}



new p5(sketch)
